        {
          id: 1,
          title: "L",
          img: "chail-grey.jpg",
          desc: "Description",
          category: "chairs",
          price: "49.99",
        },
      ],
    };
	}



	render() {
		return (
      <div className="wrapper">
        <Header />
        <Footer />
      </div>
    );
	}
}

export default App;
